import React from 'react'
import CartItems from '../Components/CartItems/CartItems'
import{Link} from 'react-router-dom'
const Cart = () => {
  return (
    <div>
      <CartItems/>
      <link to='/checkout'>Proceed To Checko</link>
    </div>
  )
}

export default Cart
